### 3.3. Multimodal Similarities: Mutual Information

We compute mutual information between fixed image $I_{A} \subseteq$ $X_{A}$ and moving image $I_{B} \subseteq X_{B}$ based on cross-mutual information function (CMIF) [26, 27]. Given images $I_{A}$ and $I_{B}$ intersecting on $I_{A B}$ and $I_{A B} \neq \emptyset$, we firstly cluster each image $I_{A}$ and $I_{B}$ into level sets $\mathcal{A} \in \mathbb{Z}$ and $\mathcal{B} \in \mathbb{Z}$ accordingly using K-means. For each level $a$ and $b$ from the level sets $\mathcal{A}$ and $\mathcal{B}$, we compute the marginal and joint histogram entries separately, Then, based on the normalized histograms, we derive the marginal and joint Shannon entropies as follows,

$$
\begin{gathered}
H_{A}=-\sum_{a \in \mathcal{A}} \frac{I_{A}^{a} \cdot I_{B}}{N_{A B}} \log \frac{I_{A}^{a} \cdot I_{B}}{N_{A B}} \\
H_{B}=-\sum_{b \in \mathcal{B}} \frac{I_{A} \cdot I_{B}^{b}}{N_{A B}} \log \frac{I_{A} \cdot I_{B}^{b}}{N_{A B}} \\
H_{A B}=-\sum_{a \in \mathcal{A}} \sum_{b \in \mathcal{B}} \frac{I_{A}^{a} \cdot I_{B}^{b}}{N_{A B}} \log \frac{I_{A}^{a} \cdot I_{B}^{b}}{N_{A B}}
\end{gathered}
$$

where $I_{A}^{a}$ and $I_{B}^{b}$ represent images where the pixel values equal to level set value $a$ and $b$ respectively; $N_{A B}$ is the number of total pixels in both image $I_{A}$ and $I_{B}$. Finally, we can compute the mutual information using $M I\left(I_{A}, I_{B}\right)=$ $H_{A}+H_{B}-H_{A B}$.
